import React from "react";
import Wrapper from '../components/Header/Wrapper';
import styled from 'styled-components';

import BachelorsDoc from "../components/Room/Docs/BachelorsDoc.jsx";
import MastersDoc from "../components/Room/Docs/MastersDoc.jsx";
import GACertDoc from "../components/Room/Docs/GACertDoc.jsx";
import GrandCanyon from "../components/Room/UploadPhotosToWeb/docs/grandCanyon.png";

// const EducationPageStyled = styled.div;

const EducationPage=() => {
    return(
        <section id="educationPage">
            <Wrapper>
            <svg viewbox="0 0 2000 1000" width="2000" height="1000">
                <defs>
                    <mask id="mask" x="0" y="0" width="2000" height="1000">
                    <rect x="-0.5" y="-0.5" width="1990" height="1990" fill="#fff"/>
                    <text x="50" text-anchor="middle" y="200" dy="0">E</text>
                    <text x="100" id="ltrV" text-anchor="middle" y="200" dy="0">D</text>
                    <text x="150" text-anchor="middle" y="200" dy="0">U</text>
                    <text x="200" text-anchor="middle" y="200" dy="0">C</text>
                    <text x="250" text-anchor="middle" y="200" dy="0">A</text>
                    <text x="300" text-anchor="middle" y="200" dy="0">T</text>
                    <text x="350" text-anchor="middle" y="200" dy="0">I</text>
                    <text x="400" text-anchor="middle" y="200" dy="0">O</text>
                    <text x="450" text-anchor="middle" y="200" dy="0">N</text>
                    </mask>
                </defs>
                <rect x="0.5" y="0.5" width="100%" height="100%" mask="url(#mask)" fill-opacity="1" fill="#E3DFD2"/>
            </svg>

                <div className="redbox">
                    <img src={GrandCanyon} alt="" id="grandCanyonImg" className="thematicImg responsive-img"/>
                </div>
                {<MastersDoc/>}
                {<BachelorsDoc/>}
                {<GACertDoc/>}
            </Wrapper>
        </section>
    )
}

export default EducationPage;
